import { Grid, Box, Typography, TextField, Paper, InputBase, IconButton, Button, Divider } from "@material-ui/core"
import CardTravelIcon from '@material-ui/icons/CardTravel';
import SaveIcon from '@material-ui/icons/Save';

export default function BoxTodo(){
    return(
        <Grid item >
            <Box>
                <Typography color='secondary' align='center' paragraph='true' compornent='h1' variant='h5' children={<div><CardTravelIcon/> Todo List</div>}/>
                <Paper>
                    <InputBase
                        placeholder='Danh sách việc cần làm'
                        inputProps={{ 'aria-label': 'todo list'}}
                    />
                    <IconButton>
                        <SaveIcon/>
                    </IconButton>
                </Paper>
            </Box>
        </Grid>
    )
}
